import React from "react";
import { Link, NavLink } from "react-router-dom";
import "./index2.css";
const Menu = () => {
    const services=()=>{
        return <h1>services</h1>
    }
  return (
    <>
      {/* <a href="/">about</a>
      <a href="/contact">contact</a> */}
      <br />
      {/* <Link activeClassName="link" to="/contact">
        contact
      </Link> */}
      <div id='div'>
        <NavLink exact activeClassName="link" to="/">
          about
        </NavLink>
        <NavLink exact activeClassName="link" to="/services">
          services
        </NavLink>
        <NavLink exact activeClassName="linked" to="/contact">
          contact
        </NavLink>
      </div>
    </>
  );
};

export default Menu;
